import { Specialty } from '../models/Specialty.model';
import { Appointment } from '../models/Appointment.model';

export class HealthcareProvider {
  id: string = ""
  personId: string = ""
  specialties: Specialty[] = []
  appointments: Appointment[] = []
  createdAt?: Date;
  updatedAt?: Date;
  isDeleted: boolean = false
}
